import { Switch, Route } from 'react-router-dom';
import './App.css';
import HomeFeed from './pages/feed/HomeFeed.jsx';
import { createMuiTheme } from '@material-ui/core/styles';

const theme = createMuiTheme({
  palette: {
    primary: {
      light: '#757ce8',
      main: '#3f50b5',
      dark: '#002884',
      contrastText: '#fff',
    },
    secondary: {
      light: '#ff7961',
      main: '#f44336',
      dark: '#ba000d',
      contrastText: '#000',
    },
  },
});

function App() {
  return (
    <div className="App">
      <ThemeProvider theme={theme}>
        <CssBaseline/>
        <Switch>
          <Route exact path='/' component={HomeFeed} />
        </Switch>
      </ThemeProvider>

    </div>
  );
}

export default App;
